import { Grid } from "@mui/material";
import SideBar from "./SideBar/SideBar";
import AddTwist from "./Twist/AddTwist";
import Twist from "./Twist/Twist";
const Home = () => {
  return (
    <Grid direction="column">
      <Grid item xs={2} sx={{ border: "1px solid black" }}>
        <SideBar></SideBar>
      </Grid>
      <Grid item>
        <AddTwist></AddTwist>
        <Twist></Twist>
      </Grid>
    </Grid>
  );
};

export default Home;
